control.onUpdate:
if (text == "IDL") {
    ee.setText(sender, "<font color = '#d03030'>销售</font>");
} else if (text == "OFL") {
    ee.setText(sender, "<font color = '#30a030'>下架</font>");
} else if (text == "DEL") {
    ee.setText(sender, "删除");
} else {
    ee.setText(sender, text);
}

control.onClick:
var r = prompt("请输入需要打印的面单数量：", "");
if (r == null) return;
r = parseInt(r);
if (isNaN(r)) {
    alert("输入必须是整数");
    return;
}
if (r <= 0) {
    alert("处理数量必须大于0");
    return;
}
g5.count = r;
g5.action = "print";
getExpress();

