taskSetItem.script2:
var token = eio.readString8();
var regDate = eio.readString8();
var action = eio.readString8();

var sql,sqlResult;
sql = "exec getUserInfoBySession '" + db.encode(token) + "'";
sqlResult = db.executeQuery("DB", sql);
if (sqlResult == null) {
    eio.appendString8("F");
    eio.appendString16("系统繁忙请稍后再试");
    es.logWarning("数据库执行错误, sql=" + sql);
    return;
}
db.read(sqlResult);
if (db.getString(sqlResult, "sessionId").length < 5) {
    eio.appendString8("F");
    eio.appendString16("token失效");
    es.logWarning("用户token失效, sql=" + sql);
    return;
}   
var userId = db.getString(sqlResult, "id");
var companyId = db.getString(sqlResult, "companyId");

//获取第一条记录
sql = 
    "select top 1 * from [order] " +
    "  where companyid = " + companyId + " and [status]= 'EP1' and regDate='" + db.encode(regDate) + "' " + 
    "  order by regDatetime desc ";
sqlResult = db.executeQuery("DB", sql);
if (sqlResult == null) {
    eio.appendString8("F");
    eio.appendString16("数据库暂时无法连接，请稍后再试");
    es.logWarning("数据库执行错误, sql=" + sql);
    return;
}
if (!db.read(sqlResult)) {
    eio.appendString8("F");
    eio.appendString16("数据已经全部处理完成，无更多的订单需要处理");
    return;
}
var addr1 = db.getString(sqlResult, "address1");
var addr2 = db.getString(sqlResult, "address2");
var addr3 = db.getString(sqlResult, "address3");
var addr = db.getString(sqlResult, "address");
var name = db.getString(sqlResult, "name");
var mobile = db.getString(sqlResult, "mobile");
var orderCount = db.getInt32(sqlResult, "orderCount");
var price = db.getString(sqlResult, "purchasePrice");
var id = db.getString(sqlResult, "id");
var expressCode = db.getString(sqlResult, "expressCode");
var expressSendCode = db.getString(sqlResult, "expressSendCode");
var expressRecvCode = db.getString(sqlResult, "expressRecvCode");

//打印确认
if (action == "print") {
    sql = 
        "exec orderPrint " +
        userId +
        "," + id;
    sqlResult = db.executeQuery("DB", sql);
    if (sqlResult == null) {
        eio.appendString8("F");
        eio.appendString16("数据库暂时无法连接，请稍后再试");
        es.logWarning("数据库执行错误, sql=" + sql);
        return;
    }
    db.read(sqlResult);
    if (db.getInt32(sqlResult, "errorCode") < 0) {
        eio.appendString8("F");
        eio.appendString16(db.getString(sqlResult, "errorString"));
        return;
    }
}

eio.appendString8("T");
eio.appendString16(addr1);
eio.appendString16(addr2);
eio.appendString16(addr3);
eio.appendString16(addr);
eio.appendString16(name);
eio.appendString16(mobile);
eio.appendString16(orderCount + "");
eio.appendString16(price);
eio.appendString16(id);
eio.appendString16(expressCode);
eio.appendString16(expressSendCode);
eio.appendString16(expressRecvCode);

